import { BrowserRouter, Route, Routes } from "react-router-dom";
import "./styles/App.css";
import About from "./pages/About";


function App() {
  return(
    <BrowserRouter>
      <Switch>
          <Route path="/about">
            <About />
          </Route>
          <Route path="/users">
            <Users />
          </Route>
          <Route path="/">
            <Home />
          </Route>
        </Switch>
    </BrowserRouter>
  )
}

export default App;
